// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract TokenSaver is Ownable {
    mapping(address => uint256) public savingBalance;
    IERC20 public floToken;

    constructor(address _floTokenAddress) {
        floToken = IERC20(_floTokenAddress);
    }

    function saveToken(uint256 _amount) public {
        floToken.transferFrom(msg.sender, address(this), _amount);
        savingBalance[msg.sender] = savingBalance[msg.sender] + _amount;
    }

    function getAllTokens() public {
        uint256 amount = savingBalance[msg.sender];
        require(amount > 0, "No Tokens staked");
        floToken.transfer(msg.sender, amount);
        savingBalance[msg.sender] = 0;
    }
}
